INSERT INTO `de_tintuc` VALUES ('19', '0', '0', 'Hướng dẫn sử dụng tool thiết kế', '', 'huong-dan-su-dung-tool-thiet-ke', '', '', '', '<p>Đầu tiên, truy cập vào&nbsp;<u><strong>trang chủ,</strong></u>&nbsp;các bạn lựa chọn đến danh mục điện thoại của mình để design.</p>\r\n\r\n<p>Ví dụ như link sản phẩm sau :&nbsp;<a href=\"http://cyo.detroopers.com/design.html#!id=13&amp;type=case&amp;name=case-iphone-6-vo-nhua-xam\" style=\"line-height: 20.7999992370605px;\" target=\"_blank\">link</a>, giao diện tool thiết kế sẽ như sau.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://cyo.detroopers.com/cms/public/uploads/HtYZoR7ttQi6as3RrLlx_Capture.PNG\" /></p>\r\n\r\n<p><u><strong>Theo danh sách từ 1 - 16</strong></u></p>\r\n\r\n<ol>\r\n	<li>Click vào hình để chọn sản phẩm, mặc định tool tự lấy cho mình.</li>\r\n	<li>Vùng thiết kế</li>\r\n	<li>Chọn hình từ máy tính để thiết kế.</li>\r\n	<li>Chọn màu sắc cho chữ</li>\r\n	<li>Nhập text rồi click vào nút dấu + kế bên</li>\r\n	<li>Chọn độ mờ của ảnh</li>\r\n	<li>Chọn nhỏ to, quay hình quay chữ</li>\r\n	<li>Vẽ các hình đơn giản</li>\r\n	<li>Chọn hình từ facebook, khi click vào nếu bạn truy cập lần đầu chương trình sẽ đòi các bạn đăng nhập để sử dụng, nếu không được các bạn coi lại có chặn popup hay không</li>\r\n	<li>Hình ảnh thư viện có sẵn của tool</li>\r\n	<li>Chỉnh màu cho ảnh</li>\r\n	<li>Set to front</li>\r\n	<li>Set to back</li>\r\n	<li>Quay 90 độ</li>\r\n	<li>Chọn font chữ cho text</li>\r\n	<li>Thanh toán với chúng tôi</li>\r\n</ol>\r\n\r\n<p><strong>Các bạn chú ý :&nbsp;</strong></p>\r\n\r\n<p>Đối với &nbsp;text các bạn muốn đổi font chữ thì chọn vào nó trên vùng thiết kế 2, rồi sau đó mới chọn Font - 5, khi đó popup chọn font sẽ xuất hiện.</p>\r\n\r\n<p>Đối với chỉnh màu sắc cho ảnh cũng vậy, các bạn chọn ảnh trước rồi mới click vào chỉnh màu - 11</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>VIDEO DEMO :</p>\r\n\r\n<p><iframe align=\"middle\" frameborder=\"0\" height=\"600\" scrolling=\"no\" src=\"https://www.youtube.com/embed/hdFzI-DKHwE\" width=\"700\"></iframe></p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '/uploads/tintuc/YW8oWVF6DLO4ZvU7REA5_Nguyen Khang.jpg', 'packages/anahkiasen/illuminage/a04f6587552d77d1fe5885e4f0c7fe19.jpg', '1', '0', '2', '', '', '', '', '', '', '2014-09-04 19:14:09', '2015-04-07 19:30:36');
INSERT INTO `de_tintuc` VALUES ('20', '0', '0', 'Cách thức giao hàng và thanh toán', '', 'cach-thuc-giao-hang-va-thanh-toan', '', 'Quân chính phủ Ukraine từ tối qua nã pháo khu vực xung quanh thành phố cảng Mariupol ở phía đông nam nước này, nhằm ngăn chặn các cuộc tiến công bằng xe tăng và pháo của phe ly khai.', '', '<p>Xin chào các bạn, sau khi thực hiện order, chúng tôi sẽ dựa vào các thông tin mà bạn đã điền vào form đặt hàng để liên hệ với bạn, cũng như để biết rõ địa chỉ để giao hàng được chính xác.</p>\r\n\r\n<p>Các bạn có 2 phương thức thanh toán :&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Chuyển khoản vào tài khoản của shop với các nội dung như tên, số điện thoại để chúng tôi xác minh, sau khi xác minh thành công, đơn hàng sẽ được chuyển đến bạn nhanh nhất tùy thuộc vào địa chỉ của bạn.</li>\r\n	<li>Các bạn có thể đưa tiền trực tiếp khi chúng tôi giao hàng, đối với các tỉnh khác thì sẽ có thêm tiền ship cho bưu điện.</li>\r\n</ol>\r\n', '', '/uploads/tintuc/eO4nV5qbaIGuwYJvY0kh_Hear Me Now.png', 'packages/anahkiasen/illuminage/424a572af1142dc434b5e63e58495ad7.png', '1', '0', '0', 'Giao tranh dữ dội ở đông nam Ukraine', '', 'Giao tranh dữ dội ở đông nam Ukraine', '', 'Giao tranh dữ dội ở đông nam Ukraine', '', '2014-09-05 03:50:03', '2015-04-12 11:51:59');
INSERT INTO `de_tintuc` VALUES ('27', '0', '0', 'Privacy Policy', '', 'privacy-policy', '', '', '', '<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Information Collection</li>\r\n	<li>Information Usage</li>\r\n	<li>Information Protection</li>\r\n	<li>Cookie Usage</li>\r\n	<li>3rd Party Disclosure</li>\r\n	<li>3rd Party Links</li>\r\n	<li>Google AdSense</li>\r\n	<li>Fair Information Practices</li>\r\n	<li>Fair information</li>\r\n	<li>Practices</li>\r\n	<li>COPPA</li>\r\n	<li>Our Contact Information</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>This privacy policy has been compiled to better serve those who are concerned with how their \'Personally identifiable information\' (PII) is being used online. PII, as used in US privacy law and information security, is information that can be used on its own or with other information to identify, contact, or locate a single person, or to identify an individual in context. Please read our privacy policy carefully to get a clear understanding of how we collect, use, protect or otherwise handle your Personally Identifiable Information in accordance with our website.</em></p>\r\n\r\n<p><strong>What personal information do we collect from the people that visit our blog, website or app?</strong><br />\r\n&nbsp;<br />\r\nWhen ordering or registering on our site, as appropriate, you may be asked to enter your name, email address or other details to help you with your experience.<br />\r\n&nbsp;<br />\r\n<strong>When do we collect information?</strong><br />\r\n&nbsp;<br />\r\nWe collect information from you when you register on our site, place an order or enter information on our site.<br />\r\n&nbsp;<br />\r\n<strong>How do we use your information?</strong><br />\r\n&nbsp;<br />\r\nWe may use the information we collect from you when you register, make a purchase, sign up for our newsletter, respond to a survey or marketing communication, surf the website, or use certain other site features in the following ways:</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; • To personalize user\'s experience and to allow us to deliver the type of content and product offerings in which you are most interested.<br />\r\n&nbsp; &nbsp; &nbsp; • To improve our website in order to better serve you.<br />\r\n&nbsp; &nbsp; &nbsp; • To allow us to better service you in responding to your customer service requests.<br />\r\n&nbsp;<br />\r\n<strong>How do we protect visitor information?</strong><br />\r\n&nbsp;<br />\r\nOur website is scanned on a regular basis for security holes and known vulnerabilities in order to make your visit to our site as safe as possible.</p>\r\n\r\n<p>We do not use Malware Scanning.</p>\r\n\r\n<p>We do not use an SSL certificate<br />\r\n&nbsp; &nbsp; &nbsp; • We only provide articles and information, we never ask for personal or private information like email addresses, or credit card numbers.<br />\r\n&nbsp;<br />\r\n<strong>Do we use \'cookies\'?</strong><br />\r\n&nbsp;<br />\r\nWe do not use cookies for tracking purposes<br />\r\n&nbsp; &nbsp; &nbsp; • Help remember and process the items in the shopping cart.</p>\r\n\r\n<p>You can choose to have your computer warn you each time a cookie is being sent, or you can choose to turn off all cookies. You do this through your browser (like Internet Explorer) settings. Each browser is a little different, so look at your browser\'s Help menu to learn the correct way to modify your cookies.<br />\r\n&nbsp;<br />\r\nIf you disable cookies off, some features will be disabled that make your site experience more efficient and some of our services will not function properly.<br />\r\n&nbsp;<br />\r\nHowever, you can still place orders .<br />\r\n&nbsp;<br />\r\n<strong>Third Party Disclosure</strong><br />\r\n&nbsp;<br />\r\nWe do not sell, trade, or otherwise transfer to outside parties your personally identifiable information.<br />\r\n&nbsp;<br />\r\n<strong>Third party links<br />\r\n&nbsp;</strong><br />\r\nOccasionally, at our discretion, we may include or offer third party products or services on our website. These third party sites have separate and independent privacy policies. We therefore have no responsibility or liability for the content and activities of these linked sites. Nonetheless, we seek to protect the integrity of our site and welcome any feedback about these sites.<br />\r\n&nbsp;<br />\r\n<strong>Google</strong><br />\r\n&nbsp;<br />\r\nGoogle\'s advertising requirements can be summed up by Google\'s Advertising Principles. They are put in place to provide a positive experience for users. https://support.google.com/adwordspolicy/answer/1316548?hl=en</p>\r\n\r\n<p>We use Google AdSense Advertising on our website.</p>\r\n\r\n<p>Google, as a third party vendor, uses cookies to serve ads on our site. Google\'s use of the DART cookie enables it to serve ads to our users based on their visit to our site and other sites on the Internet. Users may opt out of the use of the DART cookie by visiting the Google ad and content network privacy policy.</p>\r\n\r\n<p>We have implemented the following:<br />\r\n&nbsp; &nbsp; &nbsp; • Remarketing with Google AdSense<br />\r\n&nbsp; &nbsp; &nbsp; • Google Display Network Impression Reporting<br />\r\n&nbsp;<br />\r\nWe along with third-party vendors, such as Google use first-party cookies (such as the Google Analytics cookies) and third-party cookies (such as the DoubleClick cookie) or other third-party identifiers together to compile data regarding user interactions with ad impressions, and other ad service functions as they relate to our website.</p>\r\n\r\n<p>Opting out:<br />\r\nUsers can set preferences for how Google advertises to you using the Google Ad Settings page. Alternatively, you can opt out by visiting the Network Advertising initiative opt out page or permanently using the Google Analytics Opt Out Browser add on.<br />\r\n&nbsp;<br />\r\n<strong>COPPA (Children Online Privacy Protection Act)</strong><br />\r\n&nbsp;<br />\r\nWhen it comes to the collection of personal information from children under 13, the Children\'s Online Privacy Protection Act (COPPA) puts parents in control. The Federal Trade Commission, the nation\'s consumer protection agency, enforces the COPPA Rule, which spells out what operators of websites and online services must do to protect children\'s privacy and safety online.</p>\r\n\r\n<p>We do not specifically market to children under 13.<br />\r\n&nbsp;<br />\r\n<strong>Fair Information Practices</strong><br />\r\n&nbsp;<br />\r\nThe Fair Information Practices Principles form the backbone of privacy law in the United States and the concepts they include have played a significant role in the development of data protection laws around the globe. Understanding the Fair Information Practice Principles and how they should be implemented is critical to comply with the various privacy laws that protect personal information.</p>\r\n\r\n<p>In order to be in line with Fair Information Practices we will take the following responsive action, should a data breach occur:<br />\r\nWe will notify the users via email<br />\r\n&nbsp; &nbsp; &nbsp; • Other<br />\r\nwhen we have a news</p>\r\n\r\n<p>We also agree to the individual redress principle, which requires that individuals have a right to pursue legally enforceable rights against data collectors and processors who fail to adhere to the law. This principle requires not only that individuals have enforceable rights against data users, but also that individuals have recourse to courts or a government agency to investigate and/or prosecute non-compliance by data processors.</p>\r\n', '', '', '', '1', '1', '0', '', '', '', '', '', '', '2015-03-07 10:57:14', '2015-04-12 11:54:15');
